int averageCalc(int newValue, int oldValue, int count){
	int aux = 0;

	aux = (oldValue * count) + newValue;
	aux /= count + 1;

	return aux;
}

int normCalc(int number){
	if(number < 0)
		number *= -1;

	return number;
}

